import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import MembershipRegister from './membershipRegister'; // Ensure this file exists
import Events from './events'; // Ensure this file exists
import PhotosVideo from './photosVideo'; // Ensure this file exists
import Donation from './donation'; // Ensure this file exists
import About from './about'; // Ensure this file exists
import Contact from './contact'; // Ensure this file exists
import AdminLogin from './adminlogin'; // Ensure this file exists
import './styles.css'; // Import your CSS styles

function App() {
    return (
        <Router>
            <div>
                <header>
                    <h1>Edo Cultural Association</h1>
                    <nav>
                        <Link to="/">Homepage</Link>
                        <Link to="/membership-register">Membership Register</Link>
                        <Link to="/events">Events</Link>
                        <Link to="/photos-video">Photos & Video</Link>
                        <Link to="/donation">Donation</Link>
                        <Link to="/about">About</Link>
                        <Link to="/contact">Contact</Link>
                        <Link to="/admin">Admin</Link>
                    </nav>
                </header>

                <main>
                    <Routes>
                        <Route path="/" element={<Homepage />} />
                        <Route path="/membership-register" element={<MembershipRegister />} />
                        <Route path="/events" element={<Events />} />
                        <Route path="/photos-video" element={<PhotosVideo />} />
                        <Route path="/donation" element={<Donation />} />
                        <Route path="/about" element={<About />} />
                        <Route path="/contact" element={<Contact />} />
                        <Route path="/admin" element={<AdminLogin />} />
                        <Route path="*" element={<NotFound />} /> {/* Catch-all route for 404 */}
                    </Routes>
                </main>

                <footer>
                    <p>&copy; {new Date().getFullYear()} Edo Cultural Association. All rights reserved.</p>
                </footer>
            </div>
        </Router>
    );
}

// Dummy component for the homepage
function Homepage() {
    return (
        <section>
            <h2>Welcome to Edo Cultural Association</h2>
            <p>Promoting Edo culture through festivals, workshops, and community events.</p>
        </section>
    );
}

// 404 Not Found component
function NotFound() {
    return (
        <section>
            <h2>404 Not Found</h2>
            <p>Sorry, the page you are looking for does not exist.</p>
        </section>
    );
}

export default App;
